er Best\\u00e4rkung, Freude und Spass f\\u00fcr Mensch und Hund besch\\u00e4ftigen wir im KV M\\u00fcnsingen unsere Hunde sinnvoll. Vom Welpen oder jungen Familienhund \\u00fcber den ausgebildeten Sporthund bis zum Senior \\u2013 wir bieten f\\u00fcr alle Vier- und Zweibeiner die passende Trainingsgruppe an. Zudem bieten wir regelm\\u00e4ssig Kurse zu interessanten Themen an. Mit all den Aktivit\\u00e4ten setzt sich der KV M\\u00fcnsingen zum Ziel, mit gut sozialisierten Hunden und informierten Hundehaltern zu einem positiven Hunde-Image beizutragen.&nbsp; Kontaktiere uns und wir werden mit Dir zusammen die passende Aktivit\\u00e4t f\\u00fcr Dich und Deinen Hund finden.<\\/p>\",\"l18n_diffsource\":\"\"},\"newRecord\":{\"bodytext\":\"<p>Bereichert bald ein vierbeiniges Familienmitglied Dein\\/Euer Leben?<br>Suchst Du eine Lerngruppe f\\u00fcr Deinen Welpen?<br>Oder hast Du einen erwachsenen Hund und m\\u00f6chtest Deinen Vierbeiner sinnvoll auslasten? \\u200bMit artgerechter Arbeit, positiver Best\\u00e4rkung, Freude und Spass f\\u00fcr Mensch und Hund besch\\u00e4ftigen wir im KV M\\u00fcnsingen unsere Hunde sinnvoll.<\\/p>\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"tx_container_parent\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\"}}',0,'0400$fb0015fbf4b0ee29dc798e04b1afa798:aa58d78b4f5fe95c0d2d1cb36d041737'),(42,1741960973,2,'BE',1,0,1,'pages','{\"oldRecord\":{\"subtitle\":\"Kynologischer Verein M\\u00fcnsingen\",\"seo_title\":\"\"},\"newRecord\":{\"subtitle\":\"Vom Hundetraum zum Traumhund\",\"seo_title\":\"Kynologischer Verein M\\u00fcnsingen\"}}',0,'0400$fc56c438db6265de3b780441f08e420b:e175f7045d7ccbfb26ffcf279422c2e5'),(43,1741961301,2,'BE',1,0,1,'pages','{\"oldRecord\":{\"seo_ti